import React from 'react';

export default function Home({ onStartTutorial, onStartExperiment }) {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 p-6">
      <h1 className="text-4xl font-bold mb-8 text-blue-700">Welcome to Read Racer</h1>

      <button
        onClick={onStartExperiment}
        className="mb-4 px-10 py-5 bg-green-600 text-white text-lg rounded-lg hover:bg-green-700 transition"
      >
        Start Experiment
      </button>

      <p className="mb-2 text-gray-600 text-sm italic">
        New here? Try the tutorial first:
      </p>

      <button
        onClick={onStartTutorial}
        className="px-4 py-2 text-sm bg-blue-500 text-white rounded hover:bg-blue-600 transition"
      >
        Try Tutorial
      </button>
    </div>
  );
}
